script: |
  super -f text -I q2310.spq | sort > q2310.out

inputs:
  - name: q2310.spq
    data: |
      SELECT - + ( col1 ) * - - 70 FROM tab2 (FORMAT parquet) WHERE NULL BETWEEN + - col0 / + 63 * + - col1 * - - 84 * col2 AND col0 / + 28 * col1;
  - name: tab2

outputs:
  - name: q2310.out
    data: |
